    const switchViews = props.switchViews;
    const showModal = props.showModal;
    const editNote = props.editNote;
    const deleteNote =  props.deleteNote;

    return(
        <>
            <Container>
                <Row>
                    <Col>
                        <h2>My notes</h2>
                    </Col>
                    <Col>
                        <CreateNote showModal={showModal} />
                    </Col>
                    <Col>
                        <h1 onClick={switchViews}>Archived Notes</h1>
                    </Col>
                </Row>
            </Container>
            <Container>
                <ListNotes data={datos}/>
            </Container>
        </>
    );
}

